tables.table_schema:
CREATE TABLE property_vacancies (
    property_id INT PRIMARY KEY,
    property_name VARCHAR(255),
    vacancy_start_date DATE,
    vacancy_end_date DATE
);

CREATE TABLE rental_pricing_strategies (
    strategy_id INT PRIMARY KEY,
    property_id INT,
    pricing_strategy VARCHAR(50),
    last_updated TIMESTAMP
);

CREATE TABLE property_vacancies (
    property_id UUID PRIMARY KEY,
    vacancy_start_date DATE,
    vacancy_end_date DATE,
    rental_price DECIMAL
);

CREATE TABLE tenants (
    id INT PRIMARY KEY,
    name VARCHAR(100),
    email VARCHAR(100),
    phone VARCHAR(20)
);
